.video-wrap {
    position: absolute;
    top: 0;
    bottom: 0;
    width: 100%;
    height: 100%; 
    overflow: hidden;
}

.video-wrap video {
    min-width: 100%; 
    min-height: 100%; 

    /* Setting width & height to auto prevents the browser from stretching or squishing the video */
    width: auto;
    height: auto;

    /* Center the video */
    position: absolute;
    top: 100%;
    left: 50%;
    transform: translate(-50%,-50%);
}

.video-wrap p {
    overflow: hidden;
    text-shadow: rgba(0,0,0,0.2);
    text-align: center;
    color: #fff;
}

