/*Parallax Quote Inner*/

.parallax-quote-in p {
  color: #fff;
  font-size: 22px;
  text-transform: uppercase;
  font-family: "Open Sans", Arial, sans-serif;
  /*font-family: Open Sans, "Helvetica Neue", Helvetica, Arial, sans-serif;;*/

}
.parallax-quote-in-1 p {
  /* color: #717984; */
  font-weight: 200;
  color: white;

  font-size: 14px;
  font-style: italic;
  line-height: 3rem;
  font-family: "Open Sans", Arial, sans-serif;
}

.parallax-quote-in p:after,
.parallax-quote-in p:before {
  content: ' " ';
  position: absolute;
  font-family: Tahoma;
}

.parallax-quote-in p:after {
  margin-left: 3px;
}

.parallax-quote-in p:before {
  margin-left: -15px;
}

.parallax-quote-in small {
  color: #eee;
  font-size: 13px;
  font-weight: 200;
  text-transform: uppercase;
}
.parallax-quote-in-1 h4 {
  font-size: 15px; 
  font-weight: 500;
  color: lightgray;
  /* text-transform: uppercase; */
}
.parallax-quote-in-1 small {
  font-size: 14px; 
  font-weight: 500;
  color:lightgray;
  text-transform: uppercase;
}

